  \"2016-11-25T21:06:45.205687\",\n\t\"name\": \"teacher-follow-up-survey-1991-92\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The 1991-92 Teacher Follow-Up Survey (TFS
  91-92) is a longitudinal follow-up to the 1990-91 Schools and Staffing Survey (SASS
  90-91). TFS 91-92 (http://nces.ed.gov/surveys/sass/index.asp) is used to determine
  how many teachers remained at the same school, moved to another school, or left
  the profession in the year following the Schools and Staffing Survey (SASS) administration.
  TFS 91-92 was administered to a sample of teachers who completed the SASS in the
  previous year. Key statistics found from 1991-92 TFS are the percentage of teachers
  who remained at the same school, the percentage of teachers who moved to another
  school, or the percentage of teachers who left the profession in the year following
  the 1990-91 Schools and Staffing Survey (SASS) administration.\",\n\t\"license_title\":
